dom.ready(()=>{$(".ac-tercero").attr("type","search").keydown(fnAcChange).autocomplete({delay:500,minLength:5,focus:fnFalse,search:fnAcSearch,source:function(e,n){fnAutocomplete(this.element,["nombre","nif"],n,e=>e.nif+" - "+e.nombre)},select:function(e,n){return fnAcLoad(this,n.item.nif,n.item.nif+" - "+n.item.nombre)}}).change(fnAcReset).on("search",fnAcReset),$(".ac-pago").attr("type","search").keydown(fnAcChange).autocomplete({delay:500,minLength:3,focus:fnFalse,search:fnAcSearch,source:function(e,n){fnAutocomplete(this.element,["numJg","numDc"],n,e=>e.numJg+": "+e.desc)},select:function(e,n){return fnAcLoad(this,n.item.numJg,n.item.numJg+": "+n.item.desc)}}).change(fnAcReset).on("search",fnAcReset)});